import React, { Component } from 'react';
import './App.css';
import {Button, Cells, Cell, CellBody, CellFooter, ActionSheet, Toast, Gallery} from 'react-weui';
import ItemService from '../service/ItemService';
import JielongService from '../service/JielongService';
import AuthService from "../service/AuthService";
import Router from 'next/router';
import SiteHeader from '../components/Common/SiteHeader';
import Link from 'next/link';


//import styles
import 'weui';
import 'react-weui/build/packages/react-weui.css';


//import component
import Swipe from '../components/Swipe';
import Head from "../components/head";
import ProductCardGrid from "../components/ProductCards/ProductCardGrid";
import ChildrenList from '../components/JieLongDetails/ChildrenList';
import JielongContent from '../components/JieLongDetails/JieLongContent';
import Footer from "../components/Footer";
import Lang from '../lang/Lang';
import {Config} from "../Config";
import JieLongBanner from "../components/JieLongDetails/JieLongBanner";

class cartPage extends Component {
    constructor(props){
        super(props);
        this.state = {
            email: '',
            password: '',
        };
    }

    login = () => {
        let itemId = { itemId: 'a3067bcbd7521b4965ef8b43394aa011'};
        Router.push({
            pathname: '/checkoutPage',
            query: itemId,
        });
    };

    wechatlogin() {
        let origUrl ="http://localhost:3000/index";
        let authUrl ="http://localhost:3000/AuthPage";

        let params ={};
        AuthService.wechatLogin(origUrl, authUrl, params)
            .then((response) => response.json())
            .then((responseJson) => {
                console.log(responseJson);
                window.open(responseJson.auth_url, "_self");
            })
            .catch((error) => {
                console.error(error);
            });
    }


    showVoucher() {
        Router.push('/index');
        alert('Voucher here');
    }




    render() {

        return (
            <div className="App">
                <SiteHeader/>
                <div className='App-body'>

                    <Footer/>

                </div>
            </div>

        );
    }
}const styles = {
    test: {
        color: 'red',
        border: 'solid',
        borderWidth: '1px',
        borderColor: 'red'
    },
    img: {
        width: '100%',
        height: '30vw',
        objectFit: 'cover'
    },
};

export default cartPage;
